import { render } from '@testing-library/react';
import React, { Component } from 'react'
import { Row, Col, Form, Button } from "react-bootstrap"
import './Registration.css'
import Patients from '../patients/Patients'

var newPatient = {
    firstName: '',
    lastName: '',
    npi: 0,
    phoneNumber: '',
    email: '',
    streetAddress: '',
    city: '',
    state: '',
    zip: 0
}

export class Registration extends Component {
    constructor (props) {
        super(props);
        this.state = {
            patients: [
                {
                    FirstName: 'John',
                    LastName: 'Doe',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                },
                {
                    FirstName: 'Jamie',
                    LastName: 'Friend',
                    NPI: 1245319599,
                    PhoneNumber: '341-294-3432',
                    Address: {
                        Line1: '248 Spruce Street',
                        Line2: '#452',
                        City: 'Baltimoreland',
                        State: 'Maryland',
                        ZipCode: 32194
                    }
                }
            ]
        }
    }



    onFormChange (input, field) {
        console.log(input);
        console.log(field);
        switch (field) {
            case 'firstName': {
                newPatient.firstName = input;
                break;
            }

            case 'lastName': {
                newPatient.lastName = input;
                break;
            }

            case 'npi': {
                newPatient.npi = input;
                break;
            }

            case 'phone': {
                newPatient.phoneNumber = input;
                break;
            }

            case 'email': {
                newPatient.email = input;
                break;
            }

            case 'streetAddress': {
                newPatient.phoneNumber = input;
                break;
            }

            case 'city': {
                newPatient.city = input;
                break;
            }

            case 'state': {
                newPatient.state = input;
                break;
            }

            case 'zip': {
                newPatient.zip = input;
                break;
            }
        }

    }

    handleSubmit () {
        console.log('sub')
        this.setState({
            patients: [...this.state.patients, newPatient]
        });
        console.log(this.state)
    }

    render () {
        return (
            <div>
                <Form onSubmit={this.handleSubmit} className="reg-form" >
                    <h1>Availity Patient Registration</h1>
                    <Row className='mb-3'>
                        <Form.Group as={Col} md='4' controlId='validationFormik01'>
                                <Form.Control 
                                    className='form-input'
                                    type="text"
                                    name='firstName'
                                    placeholder="Enter First Name"
                                    value={newPatient.firstName}
                                    onChange={e => this.onFormChange(e.target.value, 'firstName')}
                                />
                        </Form.Group>
                        <Form.Group as={Col} md='4' controlId='validationFormik02'>
                                <Form.Control 
                                    className='form-input'
                                    type="text"
                                    name='lastName'
                                    placeholder="Enter Last Name" 
                                    value={newPatient.lastName}
                                    onChange={e => this.onFormChange(e.target.value, 'lastName')}
                                />
                        </Form.Group>
                        <Form.Group as={Col} md='4' controlId='validationFormik03'>
                                <Form.Control 
                                    className='form-input'
                                    type="text"
                                    name='npi'
                                    placeholder="Enter NPI #" 
                                    value={newPatient.npi}
                                    onChange={e => this.onFormChange(e.target.value, 'npi')}
                                />
                        </Form.Group>
                    </Row>
                    <Row className='mb-3'>
                        <Form.Group as={Col} md='6' controlId='validationFormik04'>
                                <Form.Control 
                                        className='form-input'
                                        type="text"
                                        name='phoneNumber'
                                        placeholder="Enter Phone #" 
                                        value={newPatient.phoneNumber}
                                        onChange={e => this.onFormChange(e.target.value, 'phone')}
                                    />
                        </Form.Group>
                        <Form.Group as={Col} md='6' controlId='validationFormik05'>
                                <Form.Control 
                                    className='form-input'
                                    type="text"
                                    name='emailAddress'
                                    placeholder="Enter Email Address"
                                    value={newPatient.email}
                                    onChange={e => this.onFormChange(e.target.value, 'email')}
                                />
                        </Form.Group>
                    </Row>
                    <Row className='mb-3'>
                        <Form.Group as={Col} md='3' controlId='validationFormik06'>
                            <Form.Control 
                                className='form-input'
                                type="text"
                                name='streetAddress'
                                placeholder="Enter Street Address" 
                                value={newPatient.streetAddress}
                                onChange={e => this.onFormChange(e.target.value, 'streetAddress')}
                            />
                        </Form.Group>
                        <Form.Group as={Col} md='3' controlId='validationFormik07'>
                            <Form.Control 
                                className='form-input'
                                type="text"
                                name='city'
                                placeholder="Enter City" 
                                value={newPatient.city}
                                onChange={e => this.onFormChange(e.target.value, 'city')}
                            />
                        </Form.Group>
                        <Form.Group as={Col} md='3' controlId='validationFormik08'>
                            <Form.Control 
                                className='form-input'
                                type="text"
                                name='state'
                                placeholder="Enter State"
                                value={newPatient.state}
                                onChange={e => this.onFormChange(e.target.value, 'state')}
                            />
                        </Form.Group>
                        <Form.Group as={Col} md='3' controlId='validationFormik09'>
                            <Form.Control 
                                className='form-input'
                                type="text"
                                name='zipCode'
                                placeholder="Enter Zip"
                                value={newPatient.zip}
                                onChange={e => this.onFormChange(e.target.value, 'zip')}
                            />
                        </Form.Group>
                    </Row>
                    <Button type='submit'>Submit</Button>
                </Form>
                <Patients className='patients-tbl' users={this.state.patients} />
            </div>

        )
    }
}
